import logo from './logo.svg';

import './App.css';

function Header() {
  return (
    <div>
      <header>
        <nav className='nav'>
          <img src={logo} className="App-logo" alt="logo" />
          <ul className='nav-items'>
            <li>Pricing</li>
            <li>About</li>
            <li>Contact</li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

function MainContent() {
  return (
    <div>
      <ul>
        <li>Was first realeased in 2013</li>
        <li>Was originally created by John Wick</li>
        <li>Was first realeased in 2013</li>
        <li>Was originally created by John Wick</li>
      </ul>
    </div>
  );
}

function App() {
  return (
    <div>
      <Header />
      <MainContent />
    </div>
  );
}

export default App;
